import NavBar from "./components/navbar";
import { useState, useEffect } from "react";
import { Mic, CalendarDays, LayoutList, Users, Map, ArrowLeft } from "lucide-react";

export default function Home() {
  const [isNavOpen, setIsNavOpen] = useState(false);
  const [isLoading, setIsLoading] = useState(false);
  const [isAgent, setIsAgent] = useState(false);
  const [userInput, setUserInput] = useState('');
  const [agentResponse, setAgentResponse] = useState(null); // State to store the agent's response
  const [data, setData] = useState([{prompt: '', response: ''}])

  const Spinner = () => (
    <div className="flex justify-center items-center">
      <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-gray-900"></div>
    </div>
  );

  const sendUserInput = () => {
    const newData = { prompt: userInput, response: 'Waiting for response...' }; // Initial response as a placeholder
    setData([...data, newData]); // Add the new input to the data array immediately
    setIsAgent(true);
    setIsLoading(true);
    setIsAgent()
    fetch("/agent", {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({ user_input: userInput }),
    })
    .then((res) => res.json())
    .then((agentData) => {
      setData(currentData => 
        currentData.map(item =>
          item.prompt === userInput ? { ...item, response: agentData.response } : item
        )
      );// Update the response in the data array
    })
    .finally(() => setIsLoading(false));


  };

  //   return (
  //     <div className=" w-full h-screen ">
  //       <div className="w-full flex flex-row h-screen ">
  //         <NavBar setIsNavOpen={setIsNavOpen}/>
  //         <div className="w-full flex px-[200px] items-center ">
  //           <div className="flex flex-col justify-center text-center w-full  h-fit">
  //             <div>
  //               <text className="font-bold text-2xl">
  //                 Your very own digital secretary.
  //               </text>
  //             </div>
  //             <div className="flex flex-row items-center my-10">
  //               <input
  //                 className="h-[100px] w-full  border-gray-200 border-solid border-2 pl-2 pt-2 rounded-md"
  //                 placeholder="Hi, how can I help you?"
  //               />
  //             </div>
  //             <div className="flex space-x-20 flex-row justify-center w-full">
  //               <CalendarDays size="40" />
  //               <LayoutList size="40" />
  //               <Users size="40" />
  //               <Map size="40" />
  //             </div>
  //           </div>
  //           <div className=" flex items-center">
  //             <Mic className="mx-3" size="50" />
  //           </div>
  //         </div>
  //       </div>
  //     </div>
  //   );
  // }
  return (
    <div className=" w-full h-screen ">
      <div className="w-full flex flex-row h-screen ">
        <NavBar setIsNavOpen={setIsNavOpen} />
        {!isAgent && (<div className="w-full flex px-[200px] items-center ">
          <div className="flex flex-col justify-center text-center w-full  h-fit">

            <div>

              <text className="font-bold text-2xl">
                Your very own digital secretary.
              </text>
            </div>
            <div className="flex flex-row items-center my-10 space-x-3">
              <input
                className="h-[60px] w-full border-gray-200 border-solid border-2 p-2 rounded-md"
                placeholder="Hi, how can I help you?"
                value={userInput}
                onChange={(e) => setUserInput(e.target.value)}
                onKeyDown={(e) => e.key === 'Enter' && sendUserInput()} // Use onKeyDown to detect the Enter key press
              />
              <button
                onClick={sendUserInput} // Call sendUserInput when the button is clicked
                className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
              >
                Enter
              </button>
            </div>
            <div className="flex space-x-20 flex-row justify-center w-full">
              <CalendarDays size="40" />
              <LayoutList size="40" />
              <Users size="40" />
              <Map size="40" />
            </div>
          </div>
          <div className=" flex items-center">
            <Mic className="mx-3" size="50" />
          </div>
        </div>)}

        {isAgent && (
          <div className={`w-full flex justify-center items-center transition-opacity duration-1000 ${isAgent ? 'opacity-100' : 'opacity-0'}`}>

            <div className="w-[500px] h-full flex justify-center bg-slate-200 flex-col">
              <div>
                  <button onClick={() => {
                    setIsAgent(false)
                    setAgentResponse(null)
                  }}>
                    <ArrowLeft color="black" size="20"/>
                  </button>
              </div>
              {data.map((item, index) => (
            <div key={index} className="bg-slate-200 my-2 px-3 rounded-md">
              <div className="flex flex-col">
              <div className="font-bold text-2xl duration-1000">{item.prompt}</div>
              <div className=
              "text-lg font-semibold my-3">Answer</div>
              <div className=" text-lg">{item.response}</div>
              </div>
            </div>
          ))}
          <button onClick={() => console.log(data)}>check</button>


              {agentResponse && (<div>
                <input placeholder="Type your follow up questions here" className={`w-full border-gray-200 border-solid border-2 p-2 h-fit rounded-md transition-opacity duration-1000 ${agentResponse ? 'opacity-100' : 'opacity-0'}` }/>
              </div>)}
            </div>

          </div>
        )}
      </div>
    </div>
  );
}
